import React from 'react';

class Result extends React.Component {
    constructor(props) {
        super(props);
        console.log('result:', props.data);
    }

    handleData(items) {
        let ser = 0;
        let res = [], temp = [];
        for (let i of items) {
            if (ser % 3 === 0) {
                res.push(<tr>{[...temp]}</tr>);
                temp = []; ser = 0;
            }
            temp.push(<td>{i}</td>);
            ser++;
        }
        return res;
    }

    render() {
        return (<div className='result'>
            <h1 className='title'>
                结果
            </h1>
            <table className='resultTable'>
                <tbody>
                    <tr>
                        <th colSpan={2}>基本信息</th>
                        <td></td>
                    </tr>
                </tbody>
                <tbody>
                    <tr colSpan={3}><th>学术能力</th></tr>
                    {this.handleData('Acdemic')}
                    <tr colSpan={3}><th>社交能力</th></tr>
                    {this.handleData('Social')}
                    <tr colSpan={3}><th>一般能力</th></tr>
                    {this.handleData('Normal')}
                </tbody>
            </table>
            <img src={require('./image/1.png')} />
        </div>);
    }
}

export default Result;
